import React from 'react';
import FontLightBox from './font';

export default function LightBox({ setShowFontLightBox, setNewData, sheet }) {
  return (
    <>
      {showFontLightBox && (
        <FontLightBox
          setShowFontLightBox={setShowFontLightBox}
          setNewData={setNewData}
          showFontLightBox={showFontLightBox}
          sheet={sheet}
        />
      )}
    </>
  );
}
